import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="bg-white shadow-lg fixed w-full z-50">
      <div className="max-w-7xl mx-auto px-4">
        <div className="flex justify-between items-center h-16">
          <div className="flex-shrink-0">
            <Link to="/" className="text-2xl font-bold text-blue-600">IT Solutions</Link>
          </div>

          {/* Desktop Menu */}
          <div className="hidden md:flex items-center space-x-8">
            <Link to="/" className="hover:text-blue-600">Trang chủ</Link>
            <Link to="/services" className="hover:text-blue-600">Dịch vụ</Link>
            <Link to="/solutions" className="hover:text-blue-600">Giải pháp</Link>
            <Link to="/contact" className="hover:text-blue-600">Liên hệ</Link>
          </div>

          {/* Mobile Menu Button */}
          <div className="md:hidden">
            <button onClick={() => setIsOpen(!isOpen)} className="text-gray-600">
              <svg className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                {isOpen ? (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                ) : (
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
                )}
              </svg>
            </button>
          </div>
        </div>

        {/* Mobile Menu */}
        {isOpen && (
          <div className="md:hidden">
            <div className="px-2 pt-2 pb-3 space-y-1">
              <Link to="/" className="block px-3 py-2 hover:bg-blue-50 rounded">Trang chủ</Link>
              <Link to="/services" className="block px-3 py-2 hover:bg-blue-50 rounded">Dịch vụ</Link>
              <Link to="/solutions" className="block px-3 py-2 hover:bg-blue-50 rounded">Giải pháp</Link>
              <Link to="/contact" className="block px-3 py-2 hover:bg-blue-50 rounded">Liên hệ</Link>
            </div>
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
